import React from 'react';
import logo from '../logo.svg';

class Home extends React.Component{
  render(){
    return(
      <div className='text-center text-white'>
        <h1>Welcome</h1>
        <img src={logo} className="App-logo" alt="logo" />
        <p>This project was created by</p>
        <p>-Daniel Kasnick</p>
        <p>-Alex Randle</p>
        <p>-Daniel Kasnick</p>
        <p>-Daniel Kasnick</p>
      </div>

    );
  }
}

export default Home;
